import React, { Component } from 'react';

class MyApp extends Component {
    render() {
        return (
            <div className="App">
                <h1>Chrisantus Eze</h1>
                <p>This is a publication about Chrisantus Eze</p>
            </div>
        );
    }
}

export default MyApp;
